☑️ Ban Vận động Cứu trợ Trung ương đã quyết định phân bổ hỗ trợ đợt 2 đến các địa phương với tổng số tiền là 650 tỷ đồng. 

Như vậy, sau cả hai đợt, Ban Vận động Cứu trợ Trung ương đã phân bổ tổng số tiền là 1.035 tỷ đồng.

📋 Danh sách cụ thể các địa phương như sau:

+ Tỉnh Lào Cai số tiền 180 tỷ đồng (đợt 1: 30 tỷ đồng, đợt 2: 150 tỷ đồng);

